import React from "react";
import './header.css';


const Header = () => {
    return (
        <div className="ccs__header section__header section__padding">
        <div className="ccs__header-logo__container">
        
        
        </div>
            <div className="ccs__header-name">
            <div className="css__header-name-container">
                
                <h1 className="ccs_text"> Chewy's Chop Shop</h1>
                
            </div>
            </div>
            <div className="ccs__header-logo"></div>
        </div>
    )
}
export default Header
